import React, { useContext } from "react";
import { Button, Card, Container, Row, Col } from "react-bootstrap";
import TableReservacionesHead from "./TableReservacionesHead";
import TableReservacionesBody from "./TableReservacionesBody"; 
//import ViajeContext from "context/ViajesContext";
import TableReservacionesViajeros from './TableReservacionesViajeros';
import ReservacionContext from "context/ReservacionesContext";  

const TableReservaciones = () => {
  //const { setModalShow } = useContext(ViajeContext);
  const { viajeros } = useContext(ReservacionContext);
  return (
    <>
      <Container style={{ maxWidth: "100%" }} fluid>
        <Row>
          <Col md="12">
            <Card className="strpied-tabled-with-hover">
              <Card.Header className="d-flex justify-content-between">
                <TableReservacionesHead />
                <Button type="Submit" className="btn-fill" variant="success">
                  Adicionar Resrvacion
                </Button>
              </Card.Header>
              <Card.Body className="table-full-width table-responsive px-0">
              { viajeros.lenght > 0 ? (<TableReservacionesBody  />):("no ahy viajeros")}  
              </Card.Body>
            </Card>
          </Col>
        </Row>
        <Row>
          <Col md="12">
            <Card>
              <Card.Header>
                 Nombre del head
              </Card.Header>
            </Card>
            <Card.Body>
              <TableReservacionesViajeros></TableReservacionesViajeros>
            </Card.Body>
          </Col>
        </Row>
      </Container>
    </>
  );
};

export default TableReservaciones;
